import React, {useState} from 'react';
import { LossActionRow } from './LossActionRow';
import { LossActionLevelClaim  } from './LossActionLevelClaim';

export function LossActionLevelTwo({data, columnProps, onClick}){
    const [isOpen, setIsOpen] = useState(false);

    return(
        <>
          <LossActionRow
              columnProps={columnProps}
              data={data}
              isOpen={isOpen}
              onClick={() => setIsOpen(!isOpen)}
              padding={0}
              color="violet"
          />
            {isOpen && data.actionChildItemList.map((itemLevelTwo, index) => {
              return itemLevelTwo.isClaim 
              ?
              <LossActionLevelClaim 
                data={itemLevelTwo}
                columnProps={columnProps}
              />
              :
              <LossActionRow
                columnProps={columnProps}
                data={itemLevelTwo}
                padding={25}
                color='yellow'
              />
          })}
    </>
)}
